import React from 'react';
import ReactDOM from 'react-dom';

const TodoList = () => {
    return(
        <ul>
            <li>Lern React</li>
            <li>Build Awesome App</li>
        </ul>
    );
};

const AppHeader = () => {
    return(
        <h1>My Todo List</h1>
    );
}

const SearchPanel = () => {
    return (
        <input type="text"/>
    );
};

const App = () => {
    return(
        <div>
            <AppHeader />
            <SearchPanel />
            <TodoList />
        </div>
    );
};

ReactDOM.render(<App />, document.querySelector('#root'));
